function Paramets(props){
    switch (props.type) {
        case 0:
            return(
                <form>
                    <label>Nombre</label>
                    <input type="text"/>
                </form>
            );
        case 1:
            return(
                <form>
                    <label>Numero</label>
                    <input type="text"/>
                </form>
            );
        default:
            break;
    }
}

export default Paramets
